function onload() {
document.querySelector('body').classList.add('show-blocks-on-load');

// демо - добавить всем элементам с классом modal - active

var items = document.querySelectorAll('.modal');
  Array.from(items).forEach(function (it) {
    it.classList.add('active');
  });



};  

 onload();



var container = document.getElementsByClassName("animaton");
for (var i = 0; i < container.length; i++) {
  container[i].onclick = function(event) {
    this.classList.add('animated');
  }
}


var container2 = document.getElementsByClassName("animaton3");
for (var i = 0; i < container2.length; i++) {
  container2[i].onclick = function(event) {
    this.classList.toggle('animated');
    document.querySelector('.animaton2').classList.add('animated');
    document.querySelector('.animaton').classList.remove('animated');
  }
}


var container3 = document.getElementsByClassName("box");
for (var i = 0; i < container3.length; i++) {
  container3[i].onclick = function(event) {
    this.classList.toggle('red');
  }
}



